import React from "react";
import convertIcon from "images/currencyConvert.svg";
import styled from "styled-components";

const Wrapper = styled.div`
  padding-right: 40px;
  position: relative;
`;

const Icon = styled.img`
  position: absolute;
  top: -8px;
  right: 0;
`;

function WalletCurrency() {
  return (
    <Wrapper>
      <span className="d-block font-weight-bold">2021.0131 ETH</span>
      <Icon src={convertIcon} />
    </Wrapper>
  );
}

export default WalletCurrency;
